import './ExpenseItem.css';

function ExpenseItem(props){
    
    const month= 1;
    const year= 2024;
    const day =1;

    return (
        <div className='.expense-item'>
            <div>
            <div>{month}</div>
            <div>{year}</div>
            <div>{day}</div>
            </div>

            <div>
                <h2>{props.title}</h2>
                <div> ${props.amount}</div>
            </div>



        </div>
    )

}


export default ExpenseItem;
